import React, { useContext} from "react";
import { SendemailContexte } from "./contexte/SendemailContext";
import sendEmail from "./sendEmail"



const Button = () => {
  const { objet, firstname, lastname, email, password, city, state, zip, message }
     = useContext(SendemailContexte);
  return (
    <button className="btn btn-secondary w-full mt-4" onClick={() =>
        sendEmail(
          objet, firstname, lastname, email, password, city, state, zip, message 
      )}>
          Send
    </button>
  )
}

export default Button
